import React from "react";
import styled from "styled-components";

function Third() {
  return (
    <Wrapper style={{ background: '#ECECEC', padding: '20px', alignContent: 'center', opacity: .4  }} className="container">
      <span>Third</span>
      <section>
        <p>
          Curabitur eu feugiat magna, ut malesuada est.
          {/* omitted */}
        </p>
      </section>
    </Wrapper>
  );
}

const Wrapper = styled.div`
    /* omitted */
`;

export default Third;
